import './App.css';

function App() {
  var __html = require('/viewImages/HomeView.html');
  var template = { __html: __html };

  React.module.exports = React.createClass({
    render: function() {
      return(
        <div dangerouslySetInnerHTML={template} />
      );
    }
  });
}

export default App;
